import { joinFrom } from './../util/joinFrom';
import { ApolloDatabaseDocumentMember } from './../resolvers';
import { User } from './User';
import { createMember } from './../entity';
import { Context } from '../resolvers';
import { DocumentMember as ApolloDocumentMember } from './../../../../types/resolvers-types';
import { Base } from './Base';
import logger, { Tags } from '../../../../shared/log/logger';

export class DocumentMember extends Base<
  ApolloDatabaseDocumentMember,
  ApolloDocumentMember,
  {
    user: User;
  }
> {
  constructor(docMember: ApolloDatabaseDocumentMember, from: string, context: Context) {
    super({
      name: 'DocumentMember',
      entity: docMember,
      from,
      context,
      remove: async (id) => await context.resolvers.Mutation.deleteDocumentMember(id),
      getters: {
        user: async () => {
          const u = await context.resolvers.Query.user(docMember.userId);
          const user = new User(u, joinFrom(from, 'getters.user'), context);
          return user;
        }
      },
      update: async (newEntity) => await context.resolvers.Mutation.editDocumentMember(newEntity.id, newEntity)
    });
  }

  static async create(userId: string, documentId: string, lastRead: number | string, from: string, context: Context) {
    const member = await createMember<ApolloDatabaseDocumentMember>({ userId, documentId, lastRead });
    logger.debug(`New Document Member Entity created:`, { tag: Tags.ENTITY, meta: member });

    let finalEntity = await context.resolvers.Mutation.addDocumentMember(member);
    if(!finalEntity) {
      finalEntity = member
    }
    const finalMember = new DocumentMember(finalEntity, joinFrom(from, 'DocumentMember.create'), context);
    return finalMember
  }

  static async buildFromId(ids: { documentId?: string, userId?: string, memberId?: string }, from: string, context: Context) {

    const docMemberIds = ids.memberId ? [ids.memberId] : undefined;

    const entity = (await context.resolvers.Query.documentMembers({
      documentId: ids.documentId,
      userId: ids.userId,
      ids: docMemberIds
    }))?.[0];
    if(!entity) return null;
    const member = new DocumentMember(entity, joinFrom(from, `DocumentMember.buildFromId(${ids.documentId}, ${ids.userId})`), context);
    return member;
  }
}
